function run(argv) {
	function getTime() {
		return safari.doJavaScript('if(jwplayer().getState() === "playing"){jwplayer().pause()}; jwplayer().getPosition()', {in: safari.windows[0].currentTab})
	}
	function getAuthor() {
		return safari.doJavaScript("document.getElementsByClassName('go-to-publisher')[0].innerText.replace(/.* все курсы от (.*)/g, '$1')", {in: safari.windows[0].currentTab})
	}
	function getTitle() {
		return safari.doJavaScript('jwplayer().getConfig().playlistItem.title', {in: safari.windows[0].currentTab})
	}
	function getPlaylistName() {
		return safari.doJavaScript("jwplayer().getConfig().ga.label", {in: safari.windows[0].currentTab})
	}
	function getSequence() {
		var indexIt = safari.doJavaScript("jwplayer().getPlaylistIndex()", {in: safari.windows[0].currentTab}) + 1
		var length = safari.doJavaScript("jwplayer().getPlaylist().length", {in: safari.windows[0].currentTab})
		return `${indexIt} видео из ${length}`
	}
	function getPlaylistIndex() {
		return safari.doJavaScript("jwplayer().getPlaylistIndex()", {in: safari.windows[0].currentTab})
	}

	var safari = Application("Safari");
	var result = JSON.stringify({
		currentTime: getTime(),
		playlistIndex: getPlaylistIndex(),
		allData: {
			video_id: safari.windows[0].currentTab.url(),
			title: getTitle(),
			author: getAuthor()
		},
		playlist: {
			title: getPlaylistName(),
			sequence: getSequence()
		},
		currentPlaylist: getPlaylistName()
	}, null, '\t')
	return result
}

function run(argv) {
	argv = JSON.parse(argv[0])
	function play(seekTo) {
		return safari.doJavaScript(`console.log(${'Start to play: ', seekTo}); jwplayer().seek(${seekTo}); if(jwplayer().getState() === "paused"){jwplayer().play()}`, {in: safari.windows[0].currentTab})
	}
	var safari = Application("Safari");
	var query = argv.startsAt
	play(query)
}

function run(argv) {
	argv = JSON.parse(argv[0])
	function play(seekTo, index) {
		return safari.doJavaScript(`console.log(${'Start to play: ', seekTo}); console.log(${'Playlist Index: ', index}); jwplayer().playlistItem(${index}).seek(${seekTo}); if(jwplayer().getState() === "paused"){jwplayer().play()}`, {in: safari.windows[0].currentTab})
	}
	var safari = Application("Safari");
	var query = argv.startsAt
	var playlistIndex = argv.playlistIndex
	play(query, playlistIndex)
}

